import React from 'react';
import { Link } from 'react-router-dom';

export default function NavBar() {
    return (
        <header>
            <Link to='/'>
                Visible Hand
            </Link>
            <nav>
                <Link to='/news'>뉴스</Link>
                <Link to='/feed'>피드</Link>
                <Link to='/dictionary'>사전</Link>
                <Link to='/quiz'>퀴즈</Link>
                <Link to='/mypage'>마이페이지</Link>
            </nav>
        </header>
    );
}
